// GameContent.js
import React from 'react';
import './GameContent.css';
import { useSelector } from 'react-redux';
import PlayTopSite from './PlayTopSite';
import ProductsCharactersList from './';

const GameContent = () => {
  const showGameContent = useSelector((state) => state.game.showGameContent);

  if (!showGameContent) return null;

  return (
    <div className="game-content-modal">
      <div className="game-content">
        <PlayTopSite />
        <ProductsCharactersList />
      </div>
    </div>
  );
};

export default GameContent;
